import React from 'react';
import './NotFound.css'

const NotFound = () => {
    return (
        <div className="not-found">
            <h1 className="text-center mt-5">404</h1>
            <h5>Oops! Your requested page was not found.</h5>
        </div>
    );
};

export default NotFound;
